import {ITEMS, RESOURCE, PEOPLE, PLANETS, STARSHIPS, LOADING, GET_ITEMS_CREATOR, GET_MORE_ITEMS_CREATOR} from "./LayoutConstants";


export const peopleItems = (data) => ({type: PEOPLE, payload: data});
export const planetsItems = (data) => ({type: PLANETS, payload: data});
export const starshipsItems = (data) => ({type: STARSHIPS, payload: data});
export const allItems = (data) => ({type: ITEMS, payload: data});
export const expectedResource = (data) => ({type: RESOURCE, payload: data});
export const loading = (data) => ({type: LOADING, payload: data});
export const all = () => ({type: GET_ITEMS_CREATOR});
// export const all = () => ({type: GET_MORE_ITEMS_CREATOR});
